import React, { useEffect, useState } from "react";
import Axios from "axios";
import { GoogleApiWrapper, Map } from "google-maps-react";

export class MapContainer extends React.Component {
  state = { userLocation: { lat: 32, lng: 32 }, loading: true };
  markers = { reports: [] }

  componentDidMount(props) {
    navigator.geolocation.getCurrentPosition (
      position => {
        const { latitude, longitude } = position.coords;

        this.setState({
          //current location of the user
          // userLocation: {lat: latitude, lng: longitude},

          // lat and long of the San Francisco area
          userLocation: {lat: 37.85, lng: -122.541 },
          loading: false
        });
      }, 
      () => {
        this.setState({loading:false});
      }
    );
  }

  render() {
    const { loading, userLocation } = this.state;
    const { google } = this.props;

    if (loading) {
      return null;
    }

var myHeaders = new Headers();
myHeaders.append("Authorization", "Bearer eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..YTP78qt8TUYD1JtRy3H2KTmLYLbON4rCGFFUQOLCjhg");

var requestOptions = {
  method: 'GET',
  headers: myHeaders,
  body: undefined,
  redirect: 'follow'
};

fetch("https://api.iq.inrix.com/lots/v3?point=37.74638779388551%7C-122.42209196090698&radius=1000", requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));


    return <Map google={google} initialCenter={userLocation} zoom={10} />;
  }
}

